import React, { useEffect } from 'react';
import { ContainerBase } from '../../style';
import { ContainerPage } from './style';

export default function SecondPage() {

    const listStatusCode = ()=>{
        axios
            .get(`https://http.cat/`)
    }
    useEffect(()=>{listStatusCode()},[])

 return (
   <ContainerBase>
        <ContainerPage>
                <h2>status code</h2>
            <div>
                <input
                    type='number'
                    placeholder='Digite um status code'
                />
                <button>Buscar</button>
            </div>
            <section>

            </section>
        </ContainerPage>
   </ContainerBase>
 );
}
